import React from 'react'
import { useNavigate } from 'react-router'

export default function CriarPost() {
    const navigate = useNavigate()

    const irParaPrincipal = () => {
        navigate("/")
      }
    
  return (
    <div>
         <button onClick={irParaPrincipal}>Criar Novo Post</button>
    </div>
  )
}
